import React from 'react';

const Transactions: React.FC = () => {
  return (
    <div className="space-y-6">
      <div>
        <h1 className="text-2xl font-bold text-gray-900">Transactions</h1>
        <p className="text-gray-600">Manage journal entries and financial transactions.</p>
      </div>

      <div className="card p-8 text-center">
        <h3 className="text-lg font-medium text-gray-900 mb-2">Transaction Management</h3>
        <p className="text-gray-600">This module will include journal entries, transaction recording, and financial audit trails.</p>
      </div>
    </div>
  );
};

export default Transactions;
